// src/components/Skills.js
import React from 'react';

const Skills = () => {
  return (
    <section className="skills-section">
      <h2>Skills</h2>

      <h3>Software Engineering:</h3>
      <ul>
        <li><strong>Tools:</strong> Python (Flask), Java (Spring Boot), C/C++, React, Javascript, CSS/HTML, Node.js, RESTful API, MySQL, Unix, Linux, GIT</li>
        <li><strong>Skills:</strong> Web Development, Frontend Development, Backend Development, Database Development, Object-Oriented Programming, Software Design, Systems Programming, Unit Testing</li>
      </ul>

      <h3>AI/Data Science:</h3>
      <ul>
        <li><strong>Tools:</strong> Python; Pytorch, Tensorflow, Scikit-learn, Keras, Numpy, BeautifulSoup, Selenium</li>
        <li><strong>Skills:</strong> AI/Deep Learning/Machine Learning Engineering, Computer Vision Engineering, Neural Networks, Natural Language Processing, Data Preprocessing, Web Crawling</li>
      </ul>
    </section>
  );
};

export default Skills;
